FeedPackage.Summary:
This release begins the standardisation of the library. This version supports only vCard version 2.1. support for versions 3.0 and 4.0 will be worked on. To make use of the library, add it to the references and:

using vCardLib;

//statements later...
vCardCollection contacts  = vCard.FromFile(filePath);

or

vCardCollection contacts  = vCard.FromFile(streamReader);

FeedPackage.ReleaseNotes:
Sample use

In C#
var table = new Table();
table.AddColumn("FieldId");
table.AddColumn("Value");
table.AddRow("Row1", new object[] { 1, "Some string" });
table.AddRow("Row2", new object[] { 2, 12345 });
table.AddRow(3, new object[] { 2, 12345 });
table.AddRow(4, new object[] { 2, 12345 });

In Razor
<table>
<thead>
    <tr>
    @foreach(var heading in ViewModel.Table.ColumnMetaData) {
        <th>@heading</th>
    }
    </tr>
</thead>

@foreach(var row in ViewModel.Table.Rows) {
    <tr>
        <td>@row["FieldId"]</td>
        <td>@row["Value"]</td>
    </tr>
}
</table>

That's it :-)
